INSERT INTO `chemicals` VALUES (1,'1','16','KEROSINES','016/kerosine','101316-80-7','309-881-9','Solvent naphtha (petroleum),hydrocracked heavy arom','Solvent naphtha (petroleum),hydrocracked heavy arom.','A complex combination of hydrocarbons obtained by the distillation of hydrocracked petroleum distillate.  It consists predominantly of hydrocarbons having carbon numbers predominantly in the range of C9 through C16 and boiling in the range of approximately 235?C to 290?C (455?F to 554?F).'),(2,'2','118','OTHER LUBRICANT BASE OILS','118/OLBO','72623-86-0','276-737-9','Lubricating oils (petroleum),C15-30,hydrotreated neutral oil-based','Lubricating oils (petroleum),C15-30,hydrotreated neutral oil-based','A complex combination of hydrocarbons obtained by treating light vacuum gas oil and heavy vacuum gas oil with hydrogen in the presence of a catalyst in a two stage process with dewaxing being carried out between the two stages.  It consists predominantly of hydrocarbons having carbon numbers predominantly in the range of C15 through C30 and produces a finished oil having a viscosity of approximately 15cSt at 40?C.  It contains a relatively large proportion of saturated hydrocarbons.'),(3,'3','R1','Reference','1,2,4-Trimethylbenzene','95-63-6','','Reference Chemical','1,2,4-Trimethylbenzene',''),(4,'4','187(2)','OTHER GAS OILS','187(2)/ OGO','64742-79-6','265-182-8','Gas oils (petroleum),hydrodesulfurized','Gas oils (petroleum),hydrodesulfurized','A complex combination of hydrocarbons obtained from a petroleum stock by treating with hydrogen to convert organic sulfur to hydrogen sulfide which is removed.  It consists predominantly of hydrocarbons having carbon numbers predominantly in the range of C13 through C25 and boiling in the range of approximately 230?C to 400?C (446?F to 752?F).'),(5,'5','43','KEROSINES','043/kerosine','8008-20-6','232-366-4','Kerosine (petroleum)','Kerosine (petroleum)','A complex combination of hydrocarbons produced by the distillation of crude oil.  It consists of hydrocarbons having carbon numbers predominantly in the range of C9 through C16 and boiling in the range of approximately 150?C to 290?C (320?F to 554?F).'),(6,'6','17','HEAVY FUEL OIL COMPONENTS','017/HFO','64742-78-5','265-181-2','Residues (petroleum),hydrodesulfurized atmospheric tower','Residues (petroleum),hydrodesulfurized atmospheric tower','A complex combination of hydrocarbons obtained by treating an atmospheric tower residuum with hydrogen in the presence of a catalyst under conditions primarily to remove organic sulfur compounds.  It consists of hydrocarbons having carbon numbers predominantly greater than C20 and boiling above approximately 350?C (662?F).  This stream is likely to contain 5 wt. % or more of 4- to 6-membered condensed ring aromatic hydrocarbons.'),(7,'7','R2','Reference','Pentadecane','629-62-9','','Reference Chemical','Pentadecane',''),(8,'8','181','VACUUM GAS OILS,HYDROCRACKED GAS OILS & DISTILLATE FUELS','181/ VHGO','68476-30-2','270-671-4','VACUUM GAS OILS,HYDROCRACKED GAS OILS & DISTILLATE FUELS','Fuel oil,no. 2','A distillate oil having a minimum viscosity of 32.6 SUS at 37.7?C (100?F) to a maximum of 37.9 SUS at 37.7?C (100?F).?'),(9,'9','151','OTHER LUBRICANT BASE OILS','151/OLBO','64742-55-8','265-158-7','Distillates (petroleum),hydrotreated light paraffinic','Distillates (petroleum),hydrotreated light paraffinic','A complex combination of hydrocarbons obtained by treating a petroleum fraction with hydrogen in the presence of a catalyst.  It consists of hydrocarbons having carbon numbers predominantly in the range of C15 through C30 and produces a finished oil with a viscosity of less than 100 SUS at 100?F (19cSt at 40?C).  It contains a relatively large proportion of saturated hydrocarbons.'),(10,'10','135','TREATED DISTILLATE AROMATIC EXTRACTS','135/TDAE','68814-89-1','272-342-0','Extracts (petroleum),heavy paraffinic distillates,solvent-deasphalted','Extracts (petroleum),heavy paraffinic distillates,solvent-deasphalted','A complex combination of hydrocarbons obtained as the extract from a solvent extraction of heavy paraffinic distillate.'),(11,'11','R3','Reference','Benz(a)anthracene','56-55-3','','Reference Chemical','Benz(a)anthracene',''),(12,'12','136','SLACK WAXES ','136/slack wax','92062-09-4','295-523-6','Slack wax (petroleum),hydrotreated','Slack wax (petroleum),hydrotreated','A complex combination of hydrocarbons obtained by treating slack wax with hydrogen in the presence of a catalyst.  It consists predominantly of saturated straight and branched chain hydrocarbons having carbon numbers predominantly greater than C20.'),(13,'13','6','HEAVY FUEL OIL COMPONENTS','006/HFO','64741-45-3','265-045-2','Residues (petroleum),atm. tower','Residues (petroleum),atm. tower','A complex residuum from the atmospheric distillation of crude oil.  It consists of hydrocarbons having carbon numbers predominantly greater than C20 and boiling above approximately 350?C (662?F).  This stream is likely to contain 5 wt. % or more of 4- to 6-membered condensed ring aromatic hydrocarbons.'),(14,'14','108','OTHER LUBRICANT BASE OILS','108/OLBO','91995-40-3','295-301-9','Distillates (petroleum),dewaxed light paraffinic,hydrotreated','Distillates (petroleum),dewaxed light paraffinic,hydrotreated','A complex combination of hydrocarbons obtained from an intensive treatment of dewaxed distillate by hydrogenation in the presence of a catalyst.  It consists predominantly of saturated hydrocarbons having carbon numbers predominantly in the range of C21 through C29 and produces a finished oil with a viscosity of approximately 13cSt at 50?C.'),(15,'15','82','UNREFINED / ACID TREATED OILS','082/UATO','64741-50-0','265-051-5','Distillates (petroleum),light paraffinic','Distillates (petroleum),light paraffinic','A complex combination of hydrocarbons produced by vacuum distillation of the residuum from atmospheric distillation of crude oil.  It consists of hydrocarbons having carbon numbers predominantly in the range of C15 through C30 and produces a finished oil with a viscosity of less than 100 SUS at 100?F (19cSt at 40?C).  It contains a relatively large proportion of saturated aliphatic hydrocarbons normally present in this distillation range of crude oil.'),(16,'16','104','KEROSINES','104/kerosine','64742-94-5','265-198-5','Solvent naphtha (petroleum),heavy arom.','Solvent naphtha (petroleum),heavy arom.','A complex combination of hydrocarbons obtained from distillation of aromatic streams.  It consists predominantly of aromatic hydrocarbons having carbon numbers predominantly in the range of C9 through C16 and boiling in the range of approximately 165?C to 290?C (330?F to 554?F).'),(17,'17','180','VACUUM GAS OILS,HYDROCRACKED GAS OILS & DISTILLATE FUELS','180 /VHGO','68334-30-5','269-822-7','Fuels,diesel','Fuels,diesel','A complex combination of hydrocarbons produced by the distillation of crude oil.  It consists of hydrocarbons having carbon numbers predominantly in the range of C9 through C20 and boiling in the range of approximately 163?C to 357?C (325?F to 675?F).'),(18,'18','164','HEAVY FUEL OIL COMPONENTS','164/HFO','68476-32-4','270-674-0','Fuel oil,residues-straight-run gas oils,high-sulfur','Fuel oil,residues-straight-run gas oils,high-sulfur','No EC number description available in ESIS'),(19,'19','R4','Reference','Dibenzothiophene','132-65-0','','Reference Chemical','Dibenzothiophene',''),(20,'20','191','BITUMEN','191/ BITUMEN','64742-85-4','265-188-0','Residues (petroleum),hydrodesulfurized vacuum','Residues (petroleum),hydrodesulfurized vacuum','A complex combination of hydrocarbons obtained by treating a vacuum residuum with hydrogen in the presence of a catalyst under conditions primarily to remove organic sulfur compounds.  It consists of hydrocarbons having carbon numbers predominantly greater than C34 and boiling approximately above 495?C (923?F).'),(21,'21','41','CRACKED GAS OILS','041/CGO','68921-07-3','272-930-7','Distillates (petroleum),hydrotreated light catalytic cracked','Distillates (petroleum),hydrotreated light catalytic cracked','A complex combination of hydrocarbons obtained by treating a petroleum fraction with hydrogen in the presence of a catalyst.'),(22,'22','195','UNTREATED DISTILLATE AROMATIC EXTRACTS','195/UDAE','64742-11-6','265-111-0','Extracts (petroleum),heavy naphthenic distillate solvent','Extracts (petroleum),heavy naphthenic distillate solvent','A complex combination of hydrocarbons obtained as the extract from a solvent extraction process. It consists predominantly of aromatic hydrocarbons having carbon numbers predominantly in the range of C20 through C50. This stream is likely to contain 5 wt. % or more of 4- to 6-membered condensed ring aromatic hydrocarbons.'),(23,'23','9','LOW BOILING POINT NAPHTHAS (GASOLINES)','009/gasoline','93572-35-1','297-465-7','Hydrocarbons,C7-12,C>9-arom.-rich,reforming heavy fraction','Hydrocarbons,C7-12,C>9-arom.-rich,reforming heavy fraction','A complex combination of hydrocarbons obtained by separation from the platformate-containing fraction.  It consists predominantly of nonaromatic hydrocarbons having carbon numbers predominantly in the range of C7 through C12 and boiling in the range of approximately 120?C to 210?C (248?F to 380?F) and C9 and higher aromatic hydrocarbons.'),(24,'24','119','OTHER LUBRICANT BASE OILS','119/OLBO','72623-87-1','276-738-4','Lubricating oils (petroleum),C20-50,hydrotreated neutral oil-based','Lubricating oils (petroleum),C20-50,hydrotreated neutral oil-based','A complex combination of hydrocarbons obtained by treating light vacuum gas oil,heavy vacuum gas oil and solvent deasphalted residual oil with hydrogen in the presence of a catalyst in a two stage process with dewaxing being carried out between the two stages.  It consists predominantly of hydrocarbons having carbon numbers predominantly in the range of C20 through C50 and produces a finished oil with a viscosity of approximately 32cSt at 40?C.  It contains a relatively large proportion of saturated hydrocarbons.'),(25,'25','184','VACUUM GAS OILS,HYDROCRACKED GAS OILS & DISTILLATE FUELS','184 /VHGO','92045-24-4','295-407-5','Gas oils (petroleum),hydrotreated light vacuum','Gas oils (petroleum),hydrotreated light vacuum','A complex combination of hydrocarbons that is obtained by treatment of light vacuum petroleum gas oils with hydrogen in the presence of a catalyst.  It consists of hydrocarbons having carbon numbers predominantly in the range of C13 through C30 and boiling in the range of approximately 230?C to 450?C (446?F to 842?F).'),(26,'26','60','OTHER LUBRICANT BASE OILS','060/OLBO','94733-08-1','305-588-5','Distillates (petroleum),solvent-refined hydrotreated heavy,hydrogenated','Distillates (petroleum),solvent-refined hydrotreated heavy,hydrogenated','No EC number description available in ESIS'),(27,'27','155','HEAVY FUEL OIL COMPONENTS','155/HFO','64741-67-9','265-069-3','Residues (petroleum),catalytic reformer fractionator','Residues (petroleum),catalytic reformer fractionator','A complex combination of hydrocarbons produced as the residual fraction from distillation of the product from a catalytic reforming process.  It consists of predominantly aromatic hydrocarbons having carbon numbers predominantly in the range of C10 through C25 and boiling in the range of approximately 160?C to 400?C (320?F to 725?F).  This stream is likely to contain 5 wt. % or more of 4- or 6-membered condensed ring aromatic hydrocarbons.'),(28,'28','128','KEROSINES','128/kerosine','91770-15-9','294-799-5','Kerosine (petroleum),sweetened','Kerosine (petroleum),sweetened','A complex combination of hydrocarbons obtained by subjecting a petroleum distillate to a sweetening process to convert mercaptans or to remove acidic impurities.  It consists predominantly of hydrocarbons having carbon numbers predominantly in the range of C9 through C16 and boiling in the range of 130?C to 290?C (266?F to 554?F).'),(29,'29','59','KEROSINES','059/diesel fuel','64742-47-8','931-250-7','MK1 diesel fuel','Distillates (petroleum),hydrotreated light','A complex combination of hydrocarbons obtained by treating a petroleum fraction with hydrogen in the presence of a catalyst.  It consists of hydrocarbons having carbon numbers predominantly in the range of C9 through C16 and boiling in the range of approximately 150?C to 290?C (302?F to 554?F).'),(30,'30','096A','UNTREATED DISTILLATE AROMATIC EXTRACTS','096A/UDAE','64742-04-7','265-103-7','Extracts (petroleum),heavy paraffinic distillate solvent','Extracts (petroleum),heavy paraffinic distillate solvent','A complex combination of hydrocarbons obtained as the extract from a solvent extraction process.  It consists predominantly of aromatic hydrocarbons having carbon numbers predominantly in the range of C20 through C50.  This stream is likely to contain 5 wt. % or more of 4- to 6-membered condensed ring aromatic hydrocarbons.'),(31,'31','129','HEAVY FUEL OIL COMPONENTS','129/HFO','93821-66-0','298-754-0','Residual oils (petroleum)','Residual oils (petroleum)','A complex combination of hydrocarbons,sulfur compounds and metal-containing organic compounds obtained as the residue from refinery fractionation cracking processes.  It produces a finished oil with a viscosity above 2cSt. at 100?C.'),(32,'32','21','HEAVY FUEL OIL COMPONENTS','021/HFO','64741-81-7','265-082-4','Distillates (petroleum),heavy thermal cracked','Distillates (petroleum),heavy thermal cracked','A complex combination of hydrocarbons from the distillation of the products from a thermal cracking process.  It consists predominantly of unsaturated hydrocarbons having carbon numbers predominantly in the range of C15 through C36 and boiling in the range of approximately 260?C to 480?C (500?F to 896?F).  This stream is likely to contain 5 wt. % or more of 4- to 6-membered condensed ring aromatic hydrocarbons.'),(33,'33','80','HEAVY FUEL OIL COMPONENTS','080/HFO','92045-14-2','295-396-7','Fuel oi